import React, { Component } from 'react'
import styled from 'styled-components'

import logo from '../img/logo-Abril.jpg'



class Logo extends Component {
    render() {
        return (
          
                <img src={logo} width="10" height="50" alt="" />
     
        )
    }
}

export default Logo
